import React from 'react';

const Header = () =>{
   return (
       <div className="app-header">
         <div className="nav-left">
             <a href="/">
                 <img src="https://premiumcoffee.ge/images/Juliuslogo.png"/>
             </a>
         </div>
         <div className="nav-right"></div>
       </div>
   )
}

export default Header;
